DROP TABLE IF EXISTS `device_data`;
CREATE TABLE `device_data`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `topic` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '主题',
  `device_id` int(11) NULL DEFAULT NULL COMMENT '主表ID',
  `data_type` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '数据类型',
  `data_content` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '数据主体',
  `create_time` int(32) NULL DEFAULT NULL,
  `update_time` int(32) NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
