-- ----------------------------
-- Table structure for devices
-- ----------------------------
DROP TABLE IF EXISTS `devices`;
CREATE TABLE `devices`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `product_id` int(11) NULL DEFAULT NULL,
  `data_template_id` int(11) NULL DEFAULT NULL COMMENT '数据流模板id',
  `device_name` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '设备名称',
  `device_description` varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '设备描述',
  `status` int(2) NULL DEFAULT 0 COMMENT '0 => 离线 ,1=>在线 ,2=>异常,3=>启动中',
  `device_auth` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '鉴权信息',
  `bg` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT 'bg-green' COMMENT '背景色',
  `icon` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT 'fa-desktop' COMMENT '图标',
  `create_time` int(32) NULL DEFAULT NULL,
  `update_time` int(32) NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `设备与产品`(`product_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 96671 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '设备列表' ROW_FORMAT = Compact;

